import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import LandmarkAnnotation from '../components/landmark-annotation';
import { methods, samplePayload } from '../components/landmark-annotation/payload';
import { AnnotationType } from '../types';

const LandmarkAnnotationComp: React.FC = withConnect({ type: AnnotationType.LANDMARK, methods, samplePayload })(LandmarkAnnotation);

ReactDOM.render(
  <LandmarkAnnotationComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
